column5:
Berikut adalah contoh template surat resmi dengan kop surat yang bisa digunakan dengan Laravel DOMPDF. Template ini ditulis menggunakan HTML dan CSS agar sesuai dengan format PDF yang dihasilkan oleh DOMPDF.

Contoh Template Surat Resmi

<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Surat Resmi</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            font-size: 12pt;
            margin: 0;
            padding: 0;
        }
        .kop-surat {
            text-align: center;
            margin-bottom: 20px;
            border-bottom: 2px solid black;
            padding-bottom: 10px;
        }
        .kop-surat img {
            width: 80px;
            height: auto;
        }
        .kop-surat h1 {
            font-size: 16pt;
            margin: 0;
        }
        .kop-surat p {
            margin: 5px 0;
            font-size: 12pt;
        }
        .isi-surat {
            margin: 20px;
            line-height: 1.6;
        }
        .ttd {
            margin-top: 50px;
            text-align: right;
        }
        .ttd p {
            margin: 0;
        }
    </style>
</head>
<body>
    <!-- Kop Surat -->
    <div class="kop-surat">
        <img src="path-to-logo.png" alt="Logo Instansi">
        <h1>Nama Instansi</h1>
        <p>Alamat Instansi, Kota, Provinsi</p>
        <p>Telepon: (021) 12345678 | Email: info@instansi.go.id</p>
    </div>

    <!-- Isi Surat -->
    <div class="isi-surat">
        <p><strong>Nomor:</strong> 001/SMK-TKJ/2024</p>
        <p><strong>Lampiran:</strong> -</p>
        <p><strong>Perihal:</strong> Pemberitahuan</p>
        <p>Kepada Yth,</p>
        <p>Nama Penerima<br>Alamat Penerima<br>di Tempat</p>
        <p>Dengan hormat,</p>
        <p>
            Kami dari <strong>Nama Instansi</strong> dengan ini menyampaikan bahwa ...
        </p>
        <p>Demikian surat ini kami buat, atas perhatian dan kerja samanya kami ucapkan terima kasih.</p>
    </div>

    <!-- Tanda Tangan -->
    <div class="ttd">
        <p>Hormat Kami,</p>
        <br><br>
        <p><strong>Nama Pejabat</strong></p>
        <p>Jabatan</p>
    </div>
</body>
</html>


---

Cara Penggunaan di Laravel

1. Pasang DOMPDF di Laravel
Jalankan perintah berikut untuk menginstal DOMPDF:

composer require barryvdh/laravel-dompdf


2. Gunakan Template
Simpan file template di folder resources/views dengan nama misalnya surat.blade.php.


3. Controller untuk Generate PDF
Tambahkan kode berikut di controller Anda:

use Barryvdh\DomPDF\Facade\Pdf;

public function generateSurat()
{
    $data = [
        'logo' => public_path('images/logo.png'), // Path ke logo instansi
        'nomor_surat' => '001/SMK-TKJ/2024',
        'nama_penerima' => 'Nama Penerima',
        'alamat_penerima' => 'Alamat Penerima',
        'nama_pejabat' => 'Nama Pejabat',
        'jabatan' => 'Jabatan',
    ];

    $pdf = Pdf::loadView('surat', $data);
    return $pdf->stream('surat-resmi.pdf');
}


4. Ubah Template untuk Dinamis
Gunakan variabel di template:

<p><strong>Nomor:</strong> {{ $nomor_surat }}</p>
<p>Kepada Yth,</p>
<p>{{ $nama_penerima }}<br>{{ $alamat_penerima }}<br>di Tempat</p>
<div class="ttd">
    <p><strong>{{ $nama_pejabat }}</strong></p>
    <p>{{ $jabatan }}</p>
</div>



