#include <iostream>
using namespace std;

int main() {
    const int SIZE = 5; // Jumlah siswa
    int scores[SIZE];
    int sum = 0;

    // Memasukkan nilai siswa
    cout << "Masukkan nilai untuk " << SIZE << " siswa:\n";
    for (int i = 0; i < SIZE; ++i) {
        cout << "Nilai siswa " << i + 1 << ": ";
        cin >> scores[i];
        sum += scores[i];
    }

    // Menghitung rata-rata
    double average = static_cast<double>(sum) / SIZE;

    // Menampilkan hasil
    cout << "Total nilai: " << sum << endl;
    cout << "Rata-rata nilai: " << average << endl;

    // Menentukan nilai tertinggi dan terendah
    int highest = scores[0];
    int lowest = scores[0];
    for (int i = 1; i < SIZE; ++i) {
        if (scores[i] > highest)
            highest = scores[i];
        if (scores[i] < lowest)
            lowest = scores[i];
    }

    // Menampilkan nilai tertinggi dan terendah
    cout << "Nilai tertinggi: " << highest << endl;
    cout << "Nilai terendah: " << lowest << endl;

    return 0;
}

